import React, { Fragment, useState } from "react";
import './addMember.css';
import Navbar from "../components/navbar";
import menuIcon from '../images/icons8-menu-50.png';
import axios from "axios";
import { API_ROUTES } from "../app-modules/api_routes";

const AddMember = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [formData, setFormData] = useState({
        user_honorific: '',
        user_first_name: '',
        user_middle_name: '',
        user_last_name: '',
        user_email: '',
        user_phone: '',
        user_address: '',
        user_city: '',
        user_state_of_practice: '',
        user_med_council_number: '',
        user_category: '',
        user_type: '',
        user_package_id: ''
    });
    const [errorMessage, setErrorMessage] = useState('');

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const generateUniquePaymentId = () => {
        const characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
        let paymentId = '';
        for (let i = 0; i < 5; i++) {
            paymentId += characters.charAt(Math.floor(Math.random() * characters.length));
        }
        return paymentId;
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        // Generate a unique payment ID
        const paymentId = generateUniquePaymentId();
        // Include the payment ID in the form data
        const dataToSubmit = { ...formData, user_payment_id: paymentId };
        // Send form data to server
        axios.post(API_ROUTES.addMember, dataToSubmit)
            .then(response => {
                console.log('Member added successfully:', response.data);
                // Reset form data after successful submission
                setFormData({
                    user_honorific: '',
                    user_first_name: '',
                    user_middle_name: '',
                    user_last_name: '',
                    user_email: '',
                    user_phone: '',
                    user_address: '',
                    user_city: '',
                    user_state_of_practice: '',
                    user_med_council_number: '',
                    user_category: '',
                    user_type: '',
                    user_package_id: ''
                });
            })
            .catch(error => {
                console.error('Error adding member:', error);
                // Display error message in modal
                setErrorMessage('Failed to add member. Please try again later.');
                // You can handle more specific error messages based on error.response if needed
            });
    };

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    const closeModal = () => {
        setErrorMessage('');
    };

    return (
        <Fragment>
            <div className="div_main_dashboard">
                <div className="dashboard_header_container">
                    <header className="dashboard_header">
                        <div className="header_left">
                            <img src={menuIcon} alt="Menu" className="menu-icon" onClick={toggleMenu} />
                            <h1>Add member</h1>
                        </div>
                    </header>
                </div>
                <Navbar isMenuOpen={isMenuOpen} toggleMenu={toggleMenu} />
                <div className="form-container">
                    <h2>Add Member</h2>
                    <form onSubmit={handleSubmit}>
                        {/* Your form inputs here */}
                        {/* Example of handling errors */}
                        {errorMessage && (
                            <div className="err-modal-container">
                                <div className="err-modal-content">
                                    <span className="close" onClick={closeModal}>&times;</span>
                                    <p>{errorMessage}</p>
                                </div>
                            </div>
                        )}
                        <button type="submit">Submit</button>
                    </form>
                </div>
            </div>
        </Fragment>
    );
}

export default AddMember;
